import React from 'react';

const Block = ({a} ) => {
    return (
        <ul>
            <li>Test a: {a[0]}</li>
            <li>Test b: {a[1]}</li>
            <li>Test c: {a[2]}</li>
            <></>
        </ul>
    );
};

export default Block;
